import React, {useEffect, useState} from 'react'
import { useSelector } from 'react-redux'
import UserTattooCard from './UserTattooCard'

const UserImages = () => {
    const userImagesArray = useSelector((state: any) => state.images.userImages)
    console.log("userImagesArray:" , userImagesArray)

    const arr = userImagesArray.filter((image: any) => image.userName === localStorage.getItem("userName"))
    const [userImagesByUserName, setUserImagesByUserName] = useState([...arr])

    useEffect(() => {
        const arr1 = userImagesArray.filter((image: any) => image.userName === localStorage.getItem("userName"))
        setUserImagesByUserName(arr1)
    }, [userImagesArray.length])

    return (
        <div>
            {userImagesByUserName && userImagesByUserName.map((image:any)=> <UserTattooCard {...image} />)}
        </div>
    )
}

export default UserImages
